import React from "react";
import HomeImg from '../Images/Home1.svg'
import { NavLink } from 'react-router-dom'


const Left = (props) => {

    return (
        <>
            <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex flex-column justify-content-center" >
                <h1>{props.heading}<span>{props.highlight}</span> </h1>
                <h5 className="my-2" >We have the top experts from the industries which help you to grow faster.</h5>
                <NavLink className="my-3 ServeBtn" to='/services'>Our Services</NavLink>
            </div>
        </>
    )
}

export default Left;
